import{_ as a,c as e,o as t,a7 as o}from"./chunks/framework.DD6GnKUa.js";const b=JSON.parse('{"title":"开发日记","description":"","frontmatter":{},"headers":[],"relativePath":"站长介绍/开发日记.md","filePath":"站长介绍/开发日记.md","lastUpdated":1711982284000}'),r={name:"站长介绍/开发日记.md"},i=o('<h1 id="开发日记" tabindex="-1">开发日记 <a class="header-anchor" href="#开发日记" aria-label="Permalink to &quot;开发日记&quot;">​</a></h1><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>曾经的我可能很狂妄，心高气傲，年少轻狂，做网站就要做最炫酷的，写样式就要写最花里胡哨的，对不起，现在的我写代码，能跑就行</p></div><h2 id="_2024" tabindex="-1">2024 <a class="header-anchor" href="#_2024" aria-label="Permalink to &quot;2024&quot;">​</a></h2><h3 id="_2024-03" tabindex="-1">2024.03 <a class="header-anchor" href="#_2024-03" aria-label="Permalink to &quot;2024.03&quot;">​</a></h3><h4 id="_2024-03-29" tabindex="-1">2024.03.29 <a class="header-anchor" href="#_2024-03-29" aria-label="Permalink to &quot;2024.03.29&quot;">​</a></h4><p>小笔记本电脑用大学四年了，有时候突然就蓝屏重启了，唉，啥时候能遇见个富婆给我买台电脑[狗头]</p><h4 id="_2024-03-30" tabindex="-1">2024.03.30 <a class="header-anchor" href="#_2024-03-30" aria-label="Permalink to &quot;2024.03.30&quot;">​</a></h4><p>怎么会有css这种东西啊，我艹了 想写个鼠标悬浮显示二维码好难，因为基础不熟练，试了动画和定位，显示层级也搞不定，怀疑人生了。</p><p>现在摆平了，能显示就行，虽然说会影响页面布局。</p><h4 id="_2024-03-31" tabindex="-1">2024.03.31 <a class="header-anchor" href="#_2024-03-31" aria-label="Permalink to &quot;2024.03.31&quot;">​</a></h4><p>今天准备把资源链接放进去，昨天写了显示的样式 资源链接是从bobo哥网站下载的。免去了前期收集的过程。</p><p>我将日期定为四级标题，那么月份就是三级，年份就是二级，一级就是大标题-开发日记，哈哈，在一开始就定下运营跨越年份的日期。</p><p>今天给页脚加了个网站运行时间，感觉很酷，运行时间的开始使用的是电脑文件夹中星梦启航第一代网页可以找到的最早的的最后修改时间。2022年3月10日 15:32:00</p><p>将网站头部加入了百度分析，为啥不是谷歌分析，先搜的是谷歌分析，网站没看懂，就...百度了。</p><p>问了大佬的网站用的51.la,那我也用。所以访问分析用了百度统计和51.la两个</p><h4 id="_2024-04-01" tabindex="-1">2024.04.01 <a class="header-anchor" href="#_2024-04-01" aria-label="Permalink to &quot;2024.04.01&quot;">​</a></h4><p>今天早上尝试给网站加上谷歌搜索站点验证头标签</p><p>// <meta name="google-site-verification" content="0QTiVl6hixpkg_fJQSKH37g9Y5iqklaWYFXJRt20CgU"> // 谷歌搜索站点验证头标签 // 未成功。。。</p><p>登陆了github小号，stardreamfly，fork了仓库并运行在github pages</p><p>吃了个饭回来，谷歌检索成功了，估计不久后在谷歌就可以搜到我的博客内容了。</p><p>19.30</p><p>CSDN是什么垃圾网站，个人简介连个外链都不给放，做尼玛的狗屁编程社区，真的是个垃圾堆，之前买的年费vip是我这辈子最愚蠢的投资，就当喂狗了。互联网那麽多答案你不抄，你不是纯就是坏。 我的的爬虫不要买的课的文章也不给过审。真尼玛全身敏感啊，别开网站了得了。</p><p>学习了base64，为什么是三个字节转化为4个字符，因为一个字节八位，64个字符可以代表6位，八和六的最小公倍数是24。妙啊</p>',23),p=[i];function l(s,h,_,n,c,d){return t(),e("div",null,p)}const m=a(r,[["render",l]]);export{b as __pageData,m as default};
